
class Solution {
    public char findTheDifference(String s, String t) {
        int[] alpha = new int[26];

        for (int i = 0; i < s.length(); i++) {
            alpha[s.charAt(i) - 'a']++;
        }
        for (int i = 0; i < t.length(); i++) {
            char c = t.charAt(i);
            if (alpha[c - 'a'] == 0) {
                return c;
            }
            alpha[c - 'a']--;
        }

        return ' ';
    }
}

public class Main {
    public static void main(String[] args) {
        String a1 = "";
        String b1 = "";
        String a = "abcde";
        String b = "abcde";
        System.out.println(new Solution().findTheDifference(a, b));
    }
}
